import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

const Home = () => {
  const navigate = useNavigate();

  // State to manage added books, counselors, and students
  const [books, setBooks] = useState([]);
  const [counselors, setCounselors] = useState([]);
  const [students, setStudents] = useState([]);

  // Callback functions to receive data from the AdminDashboard
  const handleAddBook = (newBook) => {
    setBooks((prevBooks) => [...prevBooks, newBook]);
  };

  const handleAddCounselor = (newCounselor) => {
    setCounselors((prevCounselors) => [...prevCounselors, newCounselor]);
  };

  const handleAddStudent = (newStudent) => {
    setStudents((prevStudents) => [...prevStudents, newStudent]);
  };

  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <h2 className="brand-name">SMHS</h2>
        <ul className="nav-links">
          <li>
            <button onClick={() => navigate("/home")} className="nav-link">Home</button>
          </li>
          <li>
            <button onClick={() => navigate("/admin-dashboard")} className="nav-link">Admin Dashboard</button>
          </li>
          <li>
            <button onClick={() => navigate("/virtual-sessions")} className="nav-link">Virtual Sessions</button>
          </li>
          <li>
            <button onClick={() => navigate("/chatbot")} className="nav-link">ChatBot</button>
          </li>
          <li>
            <button onClick={() => navigate("/login")} className="logout-button">Logout</button>
          </li>
        </ul>
      </nav>

      {/* Hero Section */}
      <header className="hero-section">
        <h1>Welcome to SMHS</h1>
        <p>Your one-stop solution for mental health resources and support</p>
      </header>

      {/* Books Section */}
      <section id="books" className="section">
        <h2>Recommended Books</h2>
        <div className="scrolling-books-container">
          {books.map((book, index) => (
            <div className="book-card" key={index}>
              {book.image && <img src={book.image} alt={book.title} />}
              <p>{book.title}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Counselors Section */}
      <section id="counselors" className="section">
        <h2>Counselors</h2>
        <div className="counselors-list">
          {counselors.map((counselor) => (
            <div className="counselor-card" key={counselor.id}>
              <h3>{counselor.name}</h3>
              <p>Specialized in: {counselor.specialization}</p>
              <p>Email: {counselor.email}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Students Section */}
      <section id="students" className="section">
        <h2>Students</h2>
        <div className="students-list">
          {students.map((student) => (
            <div className="student-card" key={student.id}>
              <h3>{student.name}</h3>
              <p>Email: {student.email}</p>
              <p>Role: {student.role}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2024 SMHS. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
